Caption:
@naomi_girma is locked in on the world’s biggest stage ⚽

Get Naomi’s inside 🤫 about her journey to the pitch and favorite pieces to wear when she’s there. Catch her on the field as the @uswnt continues their quest for star number 5 ⭐

#NikeFC

Just over a week into the global tournament and stadiums are witnessing record breaking magic.✨

@_aryborges joins only 5 other footballers by securing a 🌎🏆 debut hat trick, our @nzfootballferns win their first game at home in a global tournament, @leaschueller nets her first goal with the help of the Phantom Luna, and fans are at an all time high as they continue to show up and show out.

These are just a few recent highlights and we’re only getting started. #NikeFC

🔊🔊🔊UP

@kvinnelandslaget forward @ahegerberg is already one of this generation’s football legends—she is UNSTOPPABLE—and is making her second appearance on the world’s biggest stage.

No one is more prepared for the spotlight than Ada. Huddle up and hear what she tells herself in the biggest moments. #NikeFC

Nice To Beat You.

@sophsssmith’s smile says it all. The @uswnt forward is poised, confident, and she’s gonna score. So, if you’re a defender, know this: It’s going to be a looooooong game.

